import React from 'react';
import { BrowserRouter, Route, Switch, useRouteMatch } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import Ident from '../Identification/Identification'


function App() {
  var match = useRouteMatch()

  return (
    <BrowserRouter>
      <Switch>
        <Route path="/x">
        Nic

          <Switch>
          <Route path={`${match.url}/y`}>
          XY
          </Route>
          </Switch>

        </Route>

        <Route path="/test">
        Test
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
